import { Component, Input, OnInit } from '@angular/core';
import { JwtClientService } from '../jwt-client.service';

@Component({
  selector: 'app-edit-task',
  templateUrl: './edit-task.component.html',
  styleUrls: ['./edit-task.component.css']
})
export class EditTaskComponent implements OnInit{

  task:any={'x':'a'};
  constructor(private service:JwtClientService){
    this.service.editTask$.subscribe((message:any)=>{
      console.log(message)
      console.log(message['name'])
      console.log(message)
      this.task=message;

    })
  }


  ngOnInit(): void {

  }

}
<h1>Hello {{task }}</h1>

<form>
    <div class="form-group">
      <label for="formGroupExampleInput">Name</label>
      <input type="text" class="form-control" id="formGroupExampleInput" [placeholder]="'task.name'" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Start Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2"  required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">End Date</label>
      <input type="text" class="form-control" id="formGroupExampleInput2"  required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Status</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.status" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Priority</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.priority" required>
    </div>
    <div class="form-group">
      <label for="formGroupExampleInput2">Progress</label>
      <input type="text" class="form-control" id="formGroupExampleInput2" placeholder="task.progress" required>
    </div>
    <button type="submit" class="btn btn-primary">Update</button>
  </form>
